import React from 'react';
const TableTr = (props) => {
    return (
        <tr>
            <td>{props.yearsNumber}</td>
            <td>{props.totalSaving}</td>
            <td>{props.interestGained}</td>
            <td>{props.totalInterestGained}</td>
            <td>{props.totalInvested}</td>
        </tr>
    )
}
export default TableTr;
